import React,{useEffect} from 'react'
import Head from 'next/head'
import Show from './show-video'
import Upload from './upload-video'

const UpVideo = () => {
  useEffect(() => {

  },[])
  return(  
  <>
       
      
        <div className="video-root row justify-content-center"> 
                   <Show/>     
                   <Upload/>                                                                                
        </div>    
    <style jsx >{`
         
        html {
          font-size:10px;
          background:#334a52;
        }
        .video-root {
                margin:0;
                width:100%;
                position:fixed;
                top:50%;
                transform:translateY(-50%);         
                animation: show 1s 1 ;       
        }
        @keyframes show {
                            0% {
                                transform:translate(0,-120%);
                            }
                            100 {
                                transform:translate(0,-50%);
                            }
                        }
    `}</style>
    
  </>
)}

export default UpVideo
